import React from "react";
import line from "../assets/pattern-curved-line-2.svg";

const QuoteCard = () => {
  return (
    <div className="bg-dark-blue rounded-2xl my-56">
      <img src={require("../assets/image-jeremy-large.png")} alt="Jeremy" />
      <img src={line} alt="decorative line" />
      <h2>
        It just <b>works.</b>
      </h2>
      <p>
        "I really like how it is an all-in-one solution that handles many of the
        tasks that you would normally need separate tools to do the same job.
        This thing is a miracle worker."
      </p>
      <div>JEREMY ROBINSON</div>
      <div>CMO, FYLO</div>
    </div>
  );
};

export default QuoteCard;
